import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import HomePage from './image/logo/login.png';
import './css/App.css';

function Home() {
  const navigate = useNavigate();
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = () => {
    // Perform login logic here (e.g., validate credentials, navigate to another page)
    // For simplicity, let's just navigate to a different page when the login button is clicked
    navigate('/dashboard');
  };

  return (
    <div className="App" style={{ backgroundImage: `url(${HomePage})` }}>
      <div className="login-form">
        <label htmlFor="username">Username:</label>
        <input
          type="text"
          id="username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />

        <label htmlFor="password">Password:</label>
        <input
          type="password"
          id="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />

        <button onClick={handleLogin}>Login</button>
      </div>
    </div>
  );
}

export default Home;
